Yes, I understand that you are facing issues in creating scrolling effects similar to a pull-to-refresh mechanism. While I cannot directly fix the issue you are facing, I can certainly provide an alternative solution using scripting that you can use for educational purposes.

Here's a simple script that creates a similar pull-to-refresh effect when a user clicks and drags a specific element:

HTML:
```html
<div id="refresh">Pull to Refresh</div>
<div id="content">Content area</div>
```
CSS:
```css
#refresh {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 50px;
  background-color: #f5f5f5;
  display: flex;
  justify-content: center;
  align-items: center;
  cursor: grab;
}

#content {
  position: relative;
  top: 50px;
  height: 300px;
  overflow: auto;
}

.refreshing {
  animation: refreshing 1s ease-out;
}

@keyframes refreshing {
  from {
    transform: rotate(0deg);
  }
  to {
    transform: rotate(360deg);
  }
}
```
JavaScript:
```javascript
const refreshEl = document.getElementById('refresh');
const contentEl = document.getElementById('content');
const initialY = window.scrollY;
let dragging = false;
let threshold = 50;

refreshEl.addEventListener('mousedown', (event) => {
  dragging = true;
  initialY = window.scrollY;
  contentEl.style.transition = 'none';
});

document.addEventListener('mousemove', (event) => {
  if (!dragging) {
    return;
  }

  const yDiff = window.scrollY - initialY;
  const newY = contentEl.scrollTop - yDiff;

  if (newY < 0) {
    contentEl.scrollTop = 0;
  } else if (newY > contentEl.scrollHeight - contentEl.offsetHeight) {
    contentEl.scrollTop = contentEl.scrollHeight - contentEl.offsetHeight;
  } else {
    contentEl.scrollTop = newY;
  }
});

document.addEventListener('mouseup', () => {
  dragging = false;
  contentEl.style.transition = '';
  if (contentEl.scrollTop === 0 && refreshEl.offsetHeight <= window.innerHeight) {
    refreshEl.classList.add('refreshing');
    setTimeout(() => {
      refreshEl.classList.remove('refreshing');
    }, 1000);
  }
});

contentEl.addEventListener('scroll', () => {
  refreshEl.style.backgroundColor = initialY < window.scrollY ? '#f5f5f5' : '#e5e5e5';
  refreshEl.style.color = initialY < window.scrollY ? '#343a40' : '#aaa';
});
```
You can see this in action on the following CodePen:

<https://codepen.io/adamlucas/pen/ExqJWoJ>

When a user drags the "#refresh" element downwards, it reveals more content hidden below. If the user successfully drags the "#refresh" element below its original starting position, the refreshing animation starts, and the simulated "refreshing" or "updating" process takes place.

